import React, { useState } from "react";
import ProgressBar from "../../components/ProgressBar";
import {Ticket} from './BookingDetails'
import { useSelector } from "react-redux";
import { Link } from "react-router-dom";
import { selectedDate, selectedTime } from "../../slices/dateSlice";

export default function UserDetails () {

const name = useSelector((state)=> state.auth.name);
const surname = useSelector((state)=> state.auth.surname);
const email  = useSelector((state)=> state.auth.email);
const phone = useSelector((state)=> state.auth.phone);


    const handleSubmit = async(e) => {
        e.preventDefault()
    }
    return( 
        <>
        
    <ProgressBar/>
    <section className="booking_container">
    
            <section className="user_details">        
            <h2>Who shall we send these tickets to?</h2>
                <section className="user-container">
                    <form
                    >
                        <label htmlFor="username">Name</label>
                        <input 
                        name='username'
                        value={name}
                        onChange={(e)=> name(e.target.value)}
                        placeholder="Enter your name"/>
                    </form>
                    <form>
                        <label htmlFor="surname">Surname</label>
                        <input
                         name="surname"
                         value={surname}
                         onChange={(e)=> surname(e.target.value)} 
                         placeholder="Enter your surname"/>
                    </form>
                    <form>
                        <label htmlFor="phone">Telephone Number</label>
                        <input name='phone' 
                        type="tel"
                        value={phone}
                        onChange={(e)=> phone(e.target.value)}
                        placeholder="Enter your telephone number "/>
                    </form>
                    <form>
                        <label htmlFor='email'>Email Adress</label>
                        <input 
                        type="tel"
                        value={email}
                        onChange={(e)=> email(e.target.value)}
                        name='email' placeholder="Enter your email adress"
                        />
                    </form>
                </section>
            </section>
                <TicketOverview/>

                       </section>
                        </>
    )
}
export const TicketOverview = () => {
    const adultValue = useSelector((state)=>state.tour.adultValue);
    const childValue = useSelector((state)=> state.tour.childValue);
    const infantValue = useSelector((state)=> state.tour.infantValue);

    const adultPrice = useSelector((state)=> state.tour.adultPrice);
    const childPrice = useSelector((state)=> state.tour.childPrice);
    const infantPrice = useSelector((state)=> state.tour.infantPrice);

    const totalCost = useSelector((state)=> state.tour.totalPrice);
  const adultCost = useSelector((state) => state.tour.adultCost);
const childCost = useSelector((state)=> state.tour.childCost);
const infantCost = useSelector((state)=> state.tour.infantCost);

const tourImg = useSelector((state)=> state.tour.img);
    return(
<section>
  <h2>Your Tickets Overview</h2>
  <section>
    <img src={tourImg} alt="Tour's img"/>
        <section>
            <h2></h2>
            <img/><h3>{selectedDate}</h3>
            <img/> <h3>{selectedTime}</h3>
        </section>
        <hr/>
        <section>
            {/*Adult Peoples */}
            <section>
                <section>
                    <section>{adultValue}</section>
                    <p>Adult(18+) (€{adultPrice} )</p>
                </section>
            <h3>€{adultCost}</h3>
            </section>
            {/*Child Peoples */}
            <section>
                <section>
                <section>{childValue}</section>
                    <p>Child(6-17) (€{childPrice})</p>
                </section>
            <h3>€{childCost}</h3>
            </section>
            
            {/*Infant */}
            <section>
                <section>
                <section>{infantValue}</section>
                    <p>Infant (0-5) (€{infantPrice})</p>
                </section>
                <h3>€{infantCost}</h3>
            </section>
         </section>  
        

        <hr/>
        <section>
            <h2>Total Price</h2>
            <h2  style={{color:"#FA8B02"}}>€{totalCost}</h2>
        </section>
        <Link to='/Payment'>
            <button className="general_btn"><h3>Go to the Next Step</h3> </button>
        </Link>
    </section>
</section>
    )
}

